  false,\n\t\"url\": null,\n\t\"notes\": \"The dataset encompasses portions of Wenas
  Valley in Kitittas and Yakima Counties, Washington. The bare earth digital elevation
  models (DEMs) represent the earth's surface with all vegetation and human-made structures
  removed. The bare earth DEMs were derived from LiDAR data using TIN processing of
  the ground point returns. Some elevation values have been interpolated across areas
  in the ground model where there is no elevation data (e.g. over dense vegetation).
  The DEM grid cell size is 3-ft. The projection is NAD83 (HARN) Washington State
  Plane, South. The elevation units are in U.S. Survey Feet. Watershed Sciences, Inc.
  collected the LiDAR and created this data set for the Puget Sound LiDAR Consortium.
  Watershed Sciences, Inc. (WS) initially collected 37,969 acres of Light Detection
  and Ranging (LiDAR) data of the Wenas Valley area of interest (AOI) in Kittitas
  and Yakima Counties, WA on October 28th, 2009. This data was delivered on November
  21st, 2009. After the AOI was clear of snow, the remaining 110,255 acres were collected
  on March 22nd and from June 12th to June 16th, 2010. The total deliverable area
  including a 100 m buffer is 148,224 acres.\",\n\t\"license_title\": null,\n\t\"extras\":
